def dashboardaction(request):
    if request.method == 'POST':
         regid=request.POST['regid']
         print(regid)
         user = INVESTIGATOR(sno=request.POST['sno'], name=request.POST['name'],regid=request.POST['regid'],branch=request.POST['branch'],email=request.POST['email'],mobile=request.POST['mobile'])
         user.save()
    data = INVESTIGATOR.objects.all()
    print(data[0].sno)
    return render(request, 'dashboard.html', {'data': data})








def index(request):
    # Check if the 'my_cookie' cookie is already set
    if 'my_cookie' in request.COOKIES:
        message = f"Welcome back, {request.COOKIES['my_cookie']}!"
    else:
        message = "Welcome to my site! Please enter your name below to continue."

    # If the user submits a name, set the 'my_cookie' cookie
    if request.method == 'POST':
        response = HttpResponse("Thanks for submitting your name!")
        response.set_cookie('my_cookie', request.POST.get('name'))
        return response

    # If the user hasn't submitted a name, render the index template with the message
    return render(request, 'index.html', {'message': message})


def sessfun(request) :
    num_visits = request.session.get('num_visits', 0) + 1
    request.session['num_visits'] = num_visits 
    if num_visits > 4 : del(request.session['num_visits'])
    resp = HttpResponse('view count='+str(num_visits))
    return resp



